import { Component, Inject } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-post-teams',
  templateUrl: './post-teams.component.html'
})
export class PostTeamsComponent {

  constructor(http: HttpClient, @Inject('BASE_URL') baseUrl: string) {
    http.get(baseUrl + 'api/teams').subscribe(result => {
      console.log(JSON.stringify(result));  
    }, error => console.error(error));
  }
}


<p>A report has been produced and details have been posted to the Contentful Reviews Teams channel.</p>
